import React from 'react';
import  { useState } from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import AboutMe from './components/AboutMe';
import Services from './components/Experience';
import Research from './components/Projects';
import PatientResources from './components/PatientResources';
import Testimonials from './components/Testimonials';
import Blog from './components/Blog';
import DatalyzerDetails from './components/DatalyzerDetails';
import BrightChampsDetails from './components/BrightChampsDetails';
import Contact from './components/Contact';
import './App.css';

const App = () => {
  const [currentPage, setCurrentPage] = useState('services'); // Set the default page

  // Function to change page
  const navigateTo = (page) => {
    setCurrentPage(page);
  };

  return (
    <div className="App">
      <Navbar />
      <Home />
      <AboutMe />
      <Services />
      <Research />
      <PatientResources />
      {/* <Testimonials />
      <Blog /> */}
      <Contact />
      <div>
      {currentPage === 'services' && <Services navigateTo={navigateTo} />}
      {currentPage === 'datalyzer-details' && <DatalyzerDetails navigateTo={navigateTo} />}
      {currentPage === 'brightchamps-details' && <BrightChampsDetails navigateTo={navigateTo} />}
    </div>
    </div>

  );
};

export default App;
